import { NavLink } from "react-router-dom";
// export const FullBtn = (props) => {
//   return (
//     <>
//       <NavLink className="manager_btn_full" to={props.link}>
//         {props.name}
//       </NavLink>
//     </>
//   );
// };
export const FullBtn = (props) => {
  const LinkPage = () => {
    return (
      <NavLink to={props.link} className="manager_btn_full">
        {props.Name}
      </NavLink>
    );
  };
  const Text = () => {
    return <button className="manager_btn_full">{props.name}</button>;
  };
  return props.link ? <LinkPage /> : <Text />;
};
